  methods: {

    copyMail(){
      var self = this
      const el = document.createElement('textarea');
      el.value = "nicolas_boeuf@hotmail.fr"
      document.body.appendChild(el);
      el.select();
      document.execCommand('copy');
      document.body.removeChild(el);
      this.feedbackCopy = true
      setTimeout(function(){
        self.feedbackCopy = false
      },2000)
    }

  },

}

